package test;

public class Assignment14_Continue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// for loop
	    for (int i = 100; i <= 120; ++i) {

	      // if value of i is between 107 and 115
	      // continue is executed
	      if (i > 107 && i < 115) {
	        continue;
	      }
	      System.out.println(i);
	    }
	    
	}

}
